import React, { useState } from 'react';
import { parseExcelFile, validateStudentData } from '../utils/excelParser';
import { Upload, FileText, Users, BookOpen, User, Calendar, MapPin, CheckCircle, AlertCircle, Info } from 'lucide-react';

const ExcelImportTest = () => {
    const [importResult, setImportResult] = useState(null);
    const [isLoading, setIsLoading] = useState(false);
    const [file, setFile] = useState(null);

    const handleFileUpload = async (selectedFile) => {
        if (!selectedFile) return;

        setFile(selectedFile);
        setIsLoading(true);
        setImportResult(null);

        try {
            console.log('🔍 Starting Excel import for:', selectedFile.name);
            const result = await parseExcelFile(selectedFile);

            if (result.success) {
                // Validate the student data
                const validation = validateStudentData(result.students);

                // Use the parser's metadata instead of the stub
                const courseMetadata = result.courseMetadata;

                setImportResult({
                    ...result,
                    validation,
                    courseMetadata,
                    fileName: selectedFile.name,
                    fileSize: selectedFile.size,
                    importTime: new Date().toLocaleString()
                });

                console.log('✅ Import successful:', result);
            } else {
                setImportResult(result);
                console.error('❌ Import failed:', result.error);
            }
        } catch (error) {
            console.error('❌ Import error:', error);
            setImportResult({
                success: false,
                error: error.message,
                students: [],
                suggestions: ['Check file format', 'Ensure file is not corrupted']
            });
        } finally {
            setIsLoading(false);
        }
    };

    const renderFileUpload = () => (
        <div className="upload-section" style={{
            border: '2px dashed #d1d5db',
            borderRadius: '8px',
            padding: '2rem',
            textAlign: 'center',
            background: '#f9fafb'
        }}>
            <Upload size={48} style={{ color: '#6b7280', margin: '0 auto 1rem auto' }} />
            <h3 style={{ color: '#374151', marginBottom: '0.5rem' }}>Upload Class List Excel File</h3>
            <p style={{ color: '#6b7280', marginBottom: '1rem' }}>
                Upload institutional Excel files (.xls, .xlsx) containing class lists
            </p>

            <input
                type="file"
                accept=".xls,.xlsx"
                onChange={(e) => handleFileUpload(e.target.files[0])}
                style={{ display: 'none' }}
                id="excel-upload"
                disabled={isLoading}
            />

            <label
                htmlFor="excel-upload"
                style={{
                    display: 'inline-flex',
                    alignItems: 'center',
                    gap: '0.5rem',
                    background: '#3b82f6',
                    color: 'white',
                    padding: '0.75rem 1.5rem',
                    borderRadius: '0.5rem',
                    cursor: isLoading ? 'not-allowed' : 'pointer',
                    opacity: isLoading ? 0.5 : 1,
                    border: 'none',
                    fontSize: '0.875rem',
                    fontWeight: '500'
                }}
            >
                <FileText size={16} />
                {isLoading ? 'Processing...' : 'Choose Excel File'}
            </label>

            {file && (
                <p style={{ color: '#6b7280', marginTop: '0.5rem', fontSize: '0.875rem' }}>
                    Selected: {file.name} ({(file.size / 1024).toFixed(1)} KB)
                </p>
            )}
        </div>
    );

    const renderCourseInfo = () => {
        if (!importResult?.courseMetadata) return null;

        const { courseMetadata } = importResult;

        return (
            <div style={{
                background: 'linear-gradient(135deg, #eff6ff 0%, #dbeafe 100%)',
                border: '1px solid #bfdbfe',
                borderRadius: '8px',
                padding: '1.5rem',
                marginBottom: '1.5rem'
            }}>
                <div style={{ display: 'flex', alignItems: 'center', gap: '0.5rem', marginBottom: '1rem' }}>
                    <BookOpen size={20} style={{ color: '#3b82f6' }} />
                    <h3 style={{ color: '#1e40af', margin: 0, fontSize: '1.125rem', fontWeight: '600' }}>
                        Course Information
                    </h3>
                </div>

                <div style={{
                    display: 'grid',
                    gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))',
                    gap: '1rem'
                }}>
                    <div>
                        <strong style={{ color: '#374151' }}>Course Code:</strong>
                        <p style={{ margin: '0.25rem 0', color: '#1f2937' }}>{courseMetadata.courseCode || 'Not detected'}</p>
                    </div>
                    <div>
                        <strong style={{ color: '#374151' }}>Course Name:</strong>
                        <p style={{ margin: '0.25rem 0', color: '#1f2937' }}>{courseMetadata.courseName || 'Not detected'}</p>
                    </div>
                    <div>
                        <strong style={{ color: '#374151' }}>Section:</strong>
                        <p style={{ margin: '0.25rem 0', color: '#1f2937' }}>{courseMetadata.section || 'Not detected'}</p>
                    </div>
                    <div>
                        <strong style={{ color: '#374151' }}>Campus:</strong>
                        <p style={{ margin: '0.25rem 0', color: '#1f2937' }}>{courseMetadata.campus || 'Not detected'}</p>
                    </div>
                    <div>
                        <strong style={{ color: '#374151' }}>Professors:</strong>
                        <p style={{ margin: '0.25rem 0', color: '#1f2937' }}>{courseMetadata.professors || 'Not detected'}</p>
                    </div>
                    <div>
                        <strong style={{ color: '#374151' }}>Term:</strong>
                        <p style={{ margin: '0.25rem 0', color: '#1f2937' }}>{courseMetadata.term || 'Not detected'}</p>
                    </div>
                    {courseMetadata.hours && (
                        <div>
                            <strong style={{ color: '#374151' }}>Hours:</strong>
                            <p style={{ margin: '0.25rem 0', color: '#1f2937' }}>{courseMetadata.hours}</p>
                        </div>
                    )}
                    {courseMetadata.gradeScale && (
                        <div>
                            <strong style={{ color: '#374151' }}>Grade Scale:</strong>
                            <p style={{ margin: '0.25rem 0', color: '#1f2937' }}>{courseMetadata.gradeScale}</p>
                        </div>
                    )}
                    {courseMetadata.department && (
                        <div>
                            <strong style={{ color: '#374151' }}>Department:</strong>
                            <p style={{ margin: '0.25rem 0', color: '#1f2937' }}>{courseMetadata.department}</p>
                        </div>
                    )}
                </div>
            </div>
        );
    };

    const renderImportSummary = () => {
        if (!importResult) return null;

        const { students, validation, fileName, fileSize, importTime } = importResult;

        return (
            <div style={{
                background: importResult.success ?
                    'linear-gradient(135deg, #f0fdf4 0%, #dcfce7 100%)' :
                    'linear-gradient(135deg, #fef2f2 0%, #fee2e2 100%)',
                border: `1px solid ${importResult.success ? '#bbf7d0' : '#fecaca'}`,
                borderRadius: '8px',
                padding: '1.5rem',
                marginBottom: '1.5rem'
            }}>
                <div style={{ display: 'flex', alignItems: 'center', gap: '0.5rem', marginBottom: '1rem' }}>
                    {importResult.success ? (
                        <CheckCircle size={20} style={{ color: '#16a34a' }} />
                    ) : (
                        <AlertCircle size={20} style={{ color: '#dc2626' }} />
                    )}
                    <h3 style={{
                        color: importResult.success ? '#15803d' : '#991b1b',
                        margin: 0,
                        fontSize: '1.125rem',
                        fontWeight: '600'
                    }}>
                        {importResult.success ? 'Import Successful!' : 'Import Failed'}
                    </h3>
                </div>

                <div style={{
                    display: 'grid',
                    gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))',
                    gap: '1rem',
                    marginBottom: '1rem'
                }}>
                    <div>
                        <strong style={{ color: '#374151' }}>File:</strong>
                        <p style={{ margin: '0.25rem 0', color: '#1f2937', fontSize: '0.875rem' }}>
                            {fileName} ({(fileSize / 1024).toFixed(1)} KB)
                        </p>
                    </div>
                    <div>
                        <strong style={{ color: '#374151' }}>Imported:</strong>
                        <p style={{ margin: '0.25rem 0', color: '#1f2937', fontSize: '0.875rem' }}>
                            {importTime}
                        </p>
                    </div>
                    <div>
                        <strong style={{ color: '#374151' }}>Students Found:</strong>
                        <p style={{ margin: '0.25rem 0', color: '#1f2937', fontSize: '0.875rem' }}>
                            {students.length} students
                        </p>
                    </div>
                    <div>
                        <strong style={{ color: '#374151' }}>Data Quality:</strong>
                        <p style={{ margin: '0.25rem 0', color: '#1f2937', fontSize: '0.875rem' }}>
                            {validation?.validationScore || 0}% complete
                        </p>
                    </div>
                </div>

                {importResult.success && (
                    <p style={{
                        margin: 0,
                        color: '#166534',
                        fontSize: '0.875rem',
                        fontStyle: 'italic'
                    }}>
                        ✅ Ready for class list integration with grading system
                    </p>
                )}

                {!importResult.success && importResult.error && (
                    <div style={{
                        background: '#ffffff',
                        border: '1px solid #fca5a5',
                        borderRadius: '4px',
                        padding: '0.75rem',
                        marginTop: '0.75rem'
                    }}>
                        <p style={{ margin: 0, color: '#991b1b', fontSize: '0.875rem' }}>
                            <strong>Error:</strong> {importResult.error}
                        </p>
                    </div>
                )}
            </div>
        );
    };

    const renderStudentTable = () => {
        if (!importResult?.success || !importResult.students.length) return null;

        const { students } = importResult;

        return (
            <div style={{ marginBottom: '1.5rem' }}>
                <div style={{ display: 'flex', alignItems: 'center', gap: '0.5rem', marginBottom: '1rem' }}>
                    <Users size={20} style={{ color: '#6b7280' }} />
                    <h3 style={{ color: '#374151', margin: 0, fontSize: '1.125rem', fontWeight: '600' }}>
                        Student List ({students.length} students)
                    </h3>
                </div>

                <div style={{
                    border: '1px solid #d1d5db',
                    borderRadius: '8px',
                    overflow: 'hidden',
                    background: 'white'
                }}>
                    <div style={{ overflowX: 'auto' }}>
                        <table style={{ width: '100%', borderCollapse: 'collapse' }}>
                            <thead>
                                <tr style={{ background: '#f9fafb' }}>
                                    <th style={{ padding: '0.75rem', textAlign: 'left', fontWeight: '600', fontSize: '0.875rem', color: '#374151', borderBottom: '1px solid #e5e7eb' }}>
                                        #
                                    </th>
                                    <th style={{ padding: '0.75rem', textAlign: 'left', fontWeight: '600', fontSize: '0.875rem', color: '#374151', borderBottom: '1px solid #e5e7eb' }}>
                                        Component
                                    </th>
                                    <th style={{ padding: '0.75rem', textAlign: 'left', fontWeight: '600', fontSize: '0.875rem', color: '#374151', borderBottom: '1px solid #e5e7eb' }}>
                                        Student ID
                                    </th>
                                    <th style={{ padding: '0.75rem', textAlign: 'left', fontWeight: '600', fontSize: '0.875rem', color: '#374151', borderBottom: '1px solid #e5e7eb' }}>
                                        Name
                                    </th>
                                    <th style={{ padding: '0.75rem', textAlign: 'left', fontWeight: '600', fontSize: '0.875rem', color: '#374151', borderBottom: '1px solid #e5e7eb' }}>
                                        Program
                                    </th>
                                    <th style={{ padding: '0.75rem', textAlign: 'left', fontWeight: '600', fontSize: '0.875rem', color: '#374151', borderBottom: '1px solid #e5e7eb' }}>
                                        Level
                                    </th>
                                    <th style={{ padding: '0.75rem', textAlign: 'left', fontWeight: '600', fontSize: '0.875rem', color: '#374151', borderBottom: '1px solid #e5e7eb' }}>
                                        Campus
                                    </th>
                                    <th style={{ padding: '0.75rem', textAlign: 'left', fontWeight: '600', fontSize: '0.875rem', color: '#374151', borderBottom: '1px solid #e5e7eb' }}>
                                        Status
                                    </th>
                                    <th style={{ padding: '0.75rem', textAlign: 'left', fontWeight: '600', fontSize: '0.875rem', color: '#374151', borderBottom: '1px solid #e5e7eb' }}>
                                        Email
                                    </th>
                                </tr>
                            </thead>
                            <tbody>
                                {students.map((student, index) => (
                                    <tr key={student.id || index} style={{
                                        borderBottom: index < students.length - 1 ? '1px solid #f3f4f6' : 'none'
                                    }}>
                                        <td style={{ padding: '0.75rem', fontSize: '0.875rem', color: '#6b7280' }}>
                                            {index + 1}
                                        </td>
                                        <td style={{ padding: '0.75rem', fontSize: '0.875rem', color: '#1f2937' }}>
                                            {student.component || 'N/A'}
                                        </td>
                                        <td style={{ padding: '0.75rem', fontSize: '0.875rem', color: '#1f2937', fontWeight: '500' }}>
                                            {student.id || 'N/A'}
                                        </td>
                                        <td style={{ padding: '0.75rem', fontSize: '0.875rem', color: '#1f2937', fontWeight: '500' }}>
                                            {student.name || 'N/A'}
                                        </td>
                                        <td style={{ padding: '0.75rem', fontSize: '0.875rem', color: '#1f2937' }}>
                                            {student.program || 'N/A'}
                                        </td>
                                        <td style={{ padding: '0.75rem', fontSize: '0.875rem', color: '#1f2937' }}>
                                            {student.level || 'N/A'}
                                        </td>
                                        <td style={{ padding: '0.75rem', fontSize: '0.875rem', color: '#1f2937' }}>
                                            {student.campus || 'N/A'}
                                        </td>
                                        <td style={{ padding: '0.75rem', fontSize: '0.875rem' }}>
                                            <span style={{
                                                background: student.status === 'Enrolled' ? '#dcfce7' : '#f3f4f6',
                                                color: student.status === 'Enrolled' ? '#166534' : '#6b7280',
                                                padding: '0.25rem 0.5rem',
                                                borderRadius: '0.25rem',
                                                fontSize: '0.75rem',
                                                fontWeight: '500'
                                            }}>
                                                {student.status || 'Unknown'}
                                            </span>
                                        </td>
                                        <td style={{ padding: '0.75rem', fontSize: '0.875rem', color: '#1f2937' }}>
                                            {student.email || 'N/A'}
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        );
    };

    const renderValidationDetails = () => {
        if (!importResult?.validation) return null;

        const { validation } = importResult;

        return (
            <div style={{
                background: '#f8fafc',
                border: '1px solid #e2e8f0',
                borderRadius: '8px',
                padding: '1.5rem',
                marginBottom: '1.5rem'
            }}>
                <div style={{ display: 'flex', alignItems: 'center', gap: '0.5rem', marginBottom: '1rem' }}>
                    <Info size={20} style={{ color: '#6b7280' }} />
                    <h3 style={{ color: '#374151', margin: 0, fontSize: '1.125rem', fontWeight: '600' }}>
                        Data Validation Report
                    </h3>
                </div>

                <div style={{
                    display: 'grid',
                    gridTemplateColumns: 'repeat(auto-fit, minmax(120px, 1fr))',
                    gap: '1rem',
                    marginBottom: '1rem'
                }}>
                    <div style={{ textAlign: 'center' }}>
                        <p style={{ margin: 0, fontSize: '1.5rem', fontWeight: '700', color: '#3b82f6' }}>
                            {validation.totalStudents}
                        </p>
                        <p style={{ margin: 0, fontSize: '0.875rem', color: '#6b7280' }}>Total Students</p>
                    </div>
                    <div style={{ textAlign: 'center' }}>
                        <p style={{ margin: 0, fontSize: '1.5rem', fontWeight: '700', color: '#16a34a' }}>
                            {validation.validStudents}
                        </p>
                        <p style={{ margin: 0, fontSize: '0.875rem', color: '#6b7280' }}>Valid Records</p>
                    </div>
                    <div style={{ textAlign: 'center' }}>
                        <p style={{ margin: 0, fontSize: '1.5rem', fontWeight: '700', color: '#dc2626' }}>
                            {validation.issues.length}
                        </p>
                        <p style={{ margin: 0, fontSize: '0.875rem', color: '#6b7280' }}>Issues Found</p>
                    </div>
                    <div style={{ textAlign: 'center' }}>
                        <p style={{ margin: 0, fontSize: '1.5rem', fontWeight: '700', color: '#7c3aed' }}>
                            {validation.validationScore}%
                        </p>
                        <p style={{ margin: 0, fontSize: '0.875rem', color: '#6b7280' }}>Data Quality</p>
                    </div>
                </div>

                <div style={{
                    display: 'grid',
                    gridTemplateColumns: 'repeat(auto-fit, minmax(100px, 1fr))',
                    gap: '0.5rem'
                }}>
                    {Object.entries(validation.completenessPercentages).map(([field, percentage]) => (
                        <div key={field} style={{ textAlign: 'center', padding: '0.5rem' }}>
                            <p style={{ margin: 0, fontSize: '0.875rem', fontWeight: '500', textTransform: 'capitalize', color: '#374151' }}>
                                {field}
                            </p>
                            <p style={{ margin: 0, fontSize: '0.875rem', color: '#6b7280' }}>
                                {percentage}%
                            </p>
                        </div>
                    ))}
                </div>

                {validation.issues.length > 0 && (
                    <div style={{ marginTop: '1rem' }}>
                        <h4 style={{ color: '#dc2626', fontSize: '1rem', fontWeight: '600', marginBottom: '0.5rem' }}>
                            Issues Found:
                        </h4>
                        <ul style={{ margin: 0, paddingLeft: '1.25rem' }}>
                            {validation.issues.slice(0, 5).map((issue, index) => (
                                <li key={index} style={{ color: '#6b7280', fontSize: '0.875rem', marginBottom: '0.25rem' }}>
                                    {issue}
                                </li>
                            ))}
                            {validation.issues.length > 5 && (
                                <li style={{ color: '#6b7280', fontSize: '0.875rem', fontStyle: 'italic' }}>
                                    ... and {validation.issues.length - 5} more issues
                                </li>
                            )}
                        </ul>
                    </div>
                )}
            </div>
        );
    };

    const renderDebugInfo = () => {
        if (!importResult) return null;

        return (
            <details style={{ marginTop: '1.5rem' }}>
                <summary style={{
                    cursor: 'pointer',
                    color: '#6b7280',
                    fontSize: '0.875rem',
                    fontWeight: '500',
                    padding: '0.5rem',
                    background: '#f9fafb',
                    border: '1px solid #e5e7eb',
                    borderRadius: '4px'
                }}>
                    🔍 Debug Information (Click to expand)
                </summary>
                <div style={{
                    background: '#1f2937',
                    color: '#f9fafb',
                    padding: '1rem',
                    borderRadius: '4px',
                    marginTop: '0.5rem',
                    fontFamily: 'monospace',
                    fontSize: '0.75rem',
                    overflow: 'auto',
                    maxHeight: '300px'
                }}>
                    <pre>{JSON.stringify(importResult, null, 2)}</pre>
                </div>
            </details>
        );
    };

    return (
        <div style={{ padding: '1.5rem', maxWidth: '1200px', margin: '0 auto' }}>
            <div style={{ marginBottom: '2rem' }}>
                <h1 style={{ color: '#1f2937', fontSize: '1.875rem', fontWeight: '700', marginBottom: '0.5rem' }}>
                    📊 Excel Class List Import Test
                </h1>
                <p style={{ color: '#6b7280', margin: 0 }}>
                    Test and validate institutional Excel class list imports with comprehensive data analysis
                </p>
            </div>

            {!importResult && renderFileUpload()}

            {isLoading && (
                <div style={{
                    background: '#eff6ff',
                    border: '1px solid #bfdbfe',
                    borderRadius: '8px',
                    padding: '1.5rem',
                    textAlign: 'center'
                }}>
                    <div style={{ display: 'inline-block', animation: 'spin 1s linear infinite', marginBottom: '0.5rem' }}>
                        <FileText size={24} style={{ color: '#3b82f6' }} />
                    </div>
                    <p style={{ color: '#1e40af', margin: 0, fontWeight: '500' }}>
                        Processing Excel file...
                    </p>
                </div>
            )}

            {importResult && (
                <>
                    {renderImportSummary()}
                    {renderCourseInfo()}
                    {renderValidationDetails()}
                    {renderStudentTable()}
                    {renderDebugInfo()}
                </>
            )}

            <style jsx>{`
                @keyframes spin {
                    from { transform: rotate(0deg); }
                    to { transform: rotate(360deg); }
                }
            `}</style>
        </div>
    );
};

export default ExcelImportTest;
